////MAIN////

@use "./use/variables" as *;

* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
  font-family: Verdana, Geneva, Tahoma, sans-serif;
}

body {
  position: relative;
  background-color: #f0f0f0;
  margin: 0;
  padding: 0;
}

.background-right-top {
  position: absolute;
  right: 0;
  z-index: -2;
  top: 90px;
}

.background-left {
  position: absolute;
  left: 0;
  z-index: -2;
  top: 1200px;
}

.background-right {
  position: absolute;
  right: 0;
  z-index: -2;
  top: 3000px;
}

.background-left-bottom {
  position: absolute;
  left: 0;
  z-index: -2;
  bottom: 0px;
}
////NAVBAR////
.nav-container {
  width: 100%;
  background-color: white;
  position: fixed;
  z-index: 2;

  .navbar {
    background-color: white;
    color: black;
    display: flex;
    justify-content: space-between;
    height: 90px;
    width: 1200px;
    margin: 0 auto;

    .logo {
      padding: 15px;
      position: relative;
      top: 41px;

      img {
        background-color: white;
        position: absolute;
        margin: auto;
        top: 0;
        left: 0;
        right: 0;
        bottom: 0;
        padding: 30px;
      }
    }

    .nav-items {
      list-style: none;

      li {
        display: inline-block;
        padding: 25px 15px;
        cursor: pointer;

        p {
          display: inline;
          vertical-align: 10px;
          margin-right: 10px;
          color: black;
        }

        &:last-child {
          padding-right: 0;
          vertical-align: sub;
        }

        svg {
          fill: black;
          transition: all 0.2s ease;
        }
        svg:hover {
          fill: #00a0dd;
        }
      }
    }
  }

  ////MENU-BUTTON////
  .menuButton {
    background-color: transparent;
    border: none;
    cursor: pointer;
    display: flex;
    padding: 0;
  }
  .line {
    fill: none;
    stroke: black;
    stroke-width: 8;
    transition: stroke-dasharray 600ms cubic-bezier(0.4, 0, 0.2, 1),
      stroke-dashoffset 600ms cubic-bezier(0.4, 0, 0.2, 1);
  }
  .line1 {
    stroke-dasharray: 60 207;
    stroke-width: 8;
  }
  .line2 {
    stroke-dasharray: 60 60;
    stroke-width: 8;
  }
  .line3 {
    stroke-dasharray: 60 207;
    stroke-width: 8;
  }
  .opened .line1 {
    stroke-dasharray: 90 207;
    stroke-dashoffset: -134;
    stroke-width: 8;
  }
  .opened .line2 {
    stroke-dasharray: 1 60;
    stroke-dashoffset: -30;
    stroke-width: 8;
  }
  .opened .line3 {
    stroke-dasharray: 90 207;
    stroke-dashoffset: -134;
    stroke-width: 8;
  }
}
.menu {
  background-color: #00a0dd;
  z-index: 1;
  position: absolute;
  width: 1200px;
  position: fixed;
  top: 90px;
  margin: 0 auto;
  left: 0;
  right: 0;
  padding: 140px 100px 60px 100px;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
}
.nav-level-1 {
  width: 450px;
}
.nav-level-1,
.nav-level-2 {
  list-style: none;
  font-size: 30px;
  line-height: 70px;
  font-weight: bold;
}
.has-subPage {
  display: flex;
  justify-content: space-between;

  &:after {
    content: "+";
  }
}
.nav-level-1 li a,
p {
  text-decoration: none;
  color: white;

  &:hover {
    color: black;
    cursor: pointer;
  }
}

.nav-level-2 li a {
  text-decoration: none;
  color: black;

  &:hover {
    color: white;
  }
}

.menu-teaser {
  width: 300px;
  display: flex;
  flex-direction: column;
  align-items: center;

  .menu-teaser-image {
    height: 40px;
    width: 20px;
    background-color: #ee8018;

    &:before {
      content: "";
      display: block;
      position: relative;
      left: -30px;
      bottom: 20px;
      height: 60px;
      width: 20px;
      background-color: #ee8018;
    }
    &:after {
      content: "";
      display: block;
      position: relative;
      left: 30px;
      top: -110px;
      height: 90px;
      width: 20px;
      background-color: #ee8018;
    }
  }

  h3 {
    color: white;
    font-size: 20px;
    padding: 40px 40px 20px 40px;
    text-align: center;
  }

  p {
    color: white;
    font-size: 16px;
    line-height: 20px;
    text-align: justify;
  }
}

////BREADCRUMB////
.bread-crumb {
  position: relative;
  top: 200px;

  ul {
    list-style: none;
    display: flex;

    li {
      padding-right: 20px;

      a {
        text-decoration: none;
        font-weight: bold;
        color: #888888;

        &:hover {
          color: #00a0dd;
          border-bottom: 3px solid #00a0dd;
        }
      }
    }
  }
}

.header-image-container {
  width: 100%;
  margin: 0 auto;
  height: 800px;
  position: relative;
  top: 90px;
  z-index: -10;

  img {
    width: 100%;
    height: 100%;
    object-fit: cover;
  }
}
////WRAPPER////
.content-wrapper {
  margin: 0 auto;
  width: 1200px;

  main {
    padding-bottom: 400px;

    h1 {
      padding: 0px 0 40px 0;

      &:after {
        content: "";
        background-color: #00a0dd;
        position: relative;
        display: block;
        width: 50px;
        height: 5px;
        bottom: -15px;
      }
    }
    ////ARTICLE////
    .article-container {
      display: flex;
      flex-direction: column;
      position: relative;
      top: 240px;
      margin-bottom: 150px;

      .article-slider {
        display: flex;
        justify-content: space-between;
        margin-bottom: 30px;
        .article-slide {
          width: 380px;
          background-color: white;
          img {
            width: 380px;
            transition: all 0.3s ease;
            &:hover {
              transform: scale(1.02);
            }
          }
          .article-content {
            padding: 20px 30px 20px 40px;
            .article-date {
              color: #888888;
              padding-bottom: 40px;

              &:after {
                content: "";
                position: relative;
                top: 20px;
                display: block;
                width: 45px;
                height: 3px;
                background-color: #00a0dd;
              }
            }

            h2 {
              font-size: 20px;
            }
            p {
              font-size: 16px;
              line-height: 20px;
              text-align: justify;
              padding: 10px 0px;
              color: black;
              cursor: auto;
            }
            a {
              font-weight: bold;
              text-transform: uppercase;
              color: #00a0dd;
              text-decoration: none;
              transition: all 0.2s ease;

              &:before {
                content: "->";
                padding-right: 8px;
                font-weight: bold;
              }

              &:hover {
                border-bottom: 2px solid #00a0dd;
                margin-left: 5px;
              }
            }
          }
        }
      }
      .article-button {
        background-color: #00a0dd;
        width: fit-content;
        padding: 20px 40px;
        color: white;
        text-decoration: none;
        transition: all 0.3s ease;

        &:hover {
          transform: translateX(10px);
          background-color: #3ac1f7;
        }
      }
    }
    ////SERVICES////
    .services-container {
      display: flex;
      flex-direction: column;
      position: relative;
      top: 240px;
      margin-bottom: 150px;

      .services-slider {
        display: flex;
        justify-content: space-between;
        margin-bottom: 30px;
        margin-top: 80px;
        .services-slide {
          width: 380px;
          background-color: white;
          position: relative;

          img {
            position: absolute;
            width: 380px;
            top: -60px;
          }

          .active-gif {
            opacity: 0;
            transition: all 0.3s;
          }

          .static {
            opacity: 1;
            transition: all 0.3s;
          }

          .services-content {
            padding: 20px 30px 20px 40px;
            h2 {
              padding-top: 150px;
              font-size: 20px;
            }
            p {
              font-size: 16px;
              line-height: 20px;
              text-align: justify;
              padding: 10px 0px;
              color: black;
              cursor: auto;
            }
            a {
              font-weight: bold;
              text-transform: uppercase;
              color: #00a0dd;
              text-decoration: none;
              transition: all 0.2s ease;

              &:before {
                content: "->";
                padding-right: 8px;
                font-weight: bold;
              }

              &:hover {
                border-bottom: 2px solid #00a0dd;
                margin-left: 5px;
              }
            }
          }
        }
      }
    }

    .content-element-1 {
      color: black;
      margin-top: 100px;

      img {
        width: 100%;
        height: 100%;
        object-fit: cover;
      }

      .content-text {
        background-color: white;
        padding: 0px 40px 40px 40px;
        h2 {
          font-weight: bold;
          font-size: 24px;
          line-height: 32px;
          padding: 40px 0px 10px 0px;
        }
        h3 {
          font-size: 20px;
          font-weight: normal;
          font-style: italic;
          padding: 0px 0px 20px 0px;
        }
        p {
          color: black;
          font-size: 18px;
          line-height: 27px;
          cursor: auto;
          margin-bottom: 20px;
        }
        a {
          font-weight: bold;
          text-transform: uppercase;
          color: #00a0dd;
          text-decoration: none;
          transition: all 0.2s ease;

          &:before {
            content: "->";
            padding-right: 8px;
            font-weight: bold;
          }

          &:hover {
            border-bottom: 2px solid #00a0dd;
            margin-left: 5px;
          }
        }
      }
    }
  }
}

////FOOTER////
.footer-container {
  background-color: white;
  overflow: hidden;
  margin-top: 400px;
  width: 1200px;
  margin: 0 auto;
}

////Click-Classes////
.hidden {
  display: none;
}

.active {
  color: black;

  &:after {
    content: "-";
  }
}

.menu.hidden-teaser > .menu-teaser {
  display: none;
}
